#[test]
fn test_compute_mod_reduction_simple() {
    // Safety: Test function calling unconstrained helper
    let (q, r) = unsafe { __compute_mod_reduction(42, 10) };
    assert(q == 4); // 42 / 10 = 4
    assert(r == 2); // 42 % 10 = 2
    // Verify: 42 = 10 * 4 + 2
    assert(10 * q + r == 42);
}

